import React, {Component} from 'react';
import {Button, Header, Container, Menu} from 'semantic-ui-react';

class Nav extends Component{
    render(){
        return(
            <Menu>

                <Container>
                    <Header></Header>
                    <Header size="medium">Name: Patient's Name</Header>
                   <p>April 18, 1995 | Male</p>
                   <p>3rd St., 3rd Blk., Auread Subd., City of San Fernando</p>
                </Container>

                <Button color="blue">Edit Information</Button>
            </Menu>
        );
    }
}

export default Nav;
